import './TaskHeader.css';

const TaskHeader = () => {
    return (
        <div>
            <h1>TO - DO LIST</h1>
            <div className='header-button'>
                <button type='button'>Add New Task</button>
                <button type='button'>Delete Selected</button>
            </div>
        </div>
    );
}

export default TaskHeader;
